import './css/SearchBarComponent.css';
import React from 'react';

export class SearchBarComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            guess_val: "",
            num_guesses: 0,
            guesses: []
        }
    }

    checkAns(e) {
        e.preventDefault();
        fetch('blahblahblah')
        .then()

    }

    returnGuess(index) {
        return (
            <div>
                <div style={{clear: 'both'}}>{this.state.guesses[index][0] + " " + this.state.guesses[index][1]}</div>
            <div style={{display: 'table'}}>
                {this.state.guesses[index].splice()}
                <div style={{display: 'table-cell'}}>

                </div>
            </div>
            </div>
        )
    }

    render() {
        return (
            <div>
            <div class="box">
                <form name="search">
                    <input type="text" style={{caretColor: 'transparent'}} placeholder="Guess Here" id='search' class="input" name="txt" onMouseOut={(e) => this.blurVal(e)} onKeyUp={(e)=>this.checkAns(e)} />
                </form>
            </div>
            <div hidden={this.state.num_guesses < 1}>
                {this.returnGuess(0)}
            </div>
            <div hidden={this.state.num_guesses < 2}>
                {this.returnGuess(1)}
            </div>
            <div hidden={this.state.num_guesses < 3}>
                {this.returnGuess(2)}
            </div>
            <div hidden={this.state.num_guesses < 4}>
                {this.returnGuess(3)}
            </div>
            <div hidden={this.state.num_guesses < 5}>
                {this.returnGuess(4)}
            </div>
            <div hidden={this.state.num_guesses < 6}>
                {this.returnGuess(5)}
            </div>
            <div hidden={this.state.num_guesses < 7}>
                {this.returnGuess(6)}
            </div>
            <div hidden={this.state.num_guesses < 8}>
                {this.returnGuess(7)}
            </div>
            <div hidden={this.state.num_guesses < 9}>
                {this.returnGuess(8)}
            </div>
            </div>
        )
    }

    blurVal(e) {
        e.preventDefault();
        document.getElementById('search').value = "";
    }

}
